648837" contenteditable="true" tabindex="0" spellcheck="false" role="textbox" aria-label="false" aria-describedby="cke_280" class="keditor-ui keditor-component-content cke_editable cke_editable_inline cke_contents_ltr cke_show_borders" style="position: relative;"><section id="keditor-component-content-1551763483063" contenteditable="true" tabindex="0" spellcheck="false" role="textbox" aria-label="false" aria-describedby="cke_268" class="keditor-ui keditor-component-content cke_editable cke_editable_inline cke_contents_ltr cke_show_borders" style="position: relative;"><section id="about" class="about"><div class="themeone"><div class="container"><div class="section-title text-center boxmlaboutt1theme3 textmlaboutt1theme3"><span contenteditable="false" class="editmlaboutt1theme3" style="display: none;">edit</span> <span contenteditable="false" class="savemlaboutt1theme3">save</span><h2>A Little Story About BSY</h2></div></div><div class="row-fluid boxmlaboutt1theme1"><div id="mabout" class="col-lg-4 col-md-4 col-sm-12 col-xs-12"><div class="about-image center-block"><span contenteditable="false" class="editmlaboutt1theme1" style="display: none;">edit</span> <span contenteditable="false" class="savemlaboutt1theme1" style="display: none;">save</span> <input type="file" id="imageUploadmlaboutt1theme1" accept=".png, .jpg, .jpeg" data-cke-editable="1" contenteditable="false" data-cke-saved-name="imageUploadmlaboutt1theme1" name="imageUploadmlaboutt1theme1"> <label for="imageUploadmlaboutt1theme1" class="imageUploadmlaboutt1theme1" style="display: none;">&nbsp;</label> <img id="imagePreviewmlaboutt1theme1" data-cke-saved-src="<?php echo url('frontendimgs/BSY@Hospet-29-2-20183_imageUploadmlaboutt1theme1.jpg'); ?>" src="<?php echo url('frontendimgs/BSY@Hospet-29-2-20183_imageUploadmlaboutt1theme1.jpg'); ?>" alt="It's Me" style="width: 379px; height: 200px;">​​</div></div><div class="row-fluid"><div class="col-lg-12 col-md-12 col-sm-12 col-xs-12"><div class="about-text"><div class="boxmlaboutt1theme2 textmlaboutt1theme2"><p style="text-align: justify;">Shri&nbsp;<strong>B.S.</strong>&nbsp;Yeddyurappa was born to Shri Siddalingappa, a farmer and Smt. Puttatayamma at Bookanakere of Krishnarajpet Taluk in Mandya District on 27th February 1943 in the family of two brothers and two sisters. He completed his B.A. Graduation in Bangalore. He came in to the contact of RSS and started his service to the mother nation at the age of 15 only. In 1965 Shri Yeddyurappa went to Shikaripura in Shivamogga district for spreading the work of Rashtriya Swayamsevak Sangh. He developed a good rapport with the public and people of Shikaripura because of his simplicity and uncompromising dedication towards the work. He married Smt. Maitradevi on march 5th 1967&nbsp; is blessed with two sons and&nbsp;three daughters. He worked as a Sangha Karyavaha during 1970-72. In 1972 at the age of 29 years he entered public life by becoming the Taluk President of Janasangh in Shikaripura. From 1974 to 1976 he served as the Director of Veerashaiva Cooperative Society and rendered a good service in the field of co operative sector.​&nbsp;<a data-cke-saved-href="https://yeddyurappa.in/about/" href="https://yeddyurappa.in/about/">Read More</a></p></div></div></div></div></div></div></section></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><div class="keditor-toolbar keditor-toolbar-component" style="display: none;"><br></div></section><di